const AnnouncementBanner = () => {
  return (
    <div style={{ backgroundColor: '#605651' }}>
      <div className="relative mx-auto px-6 md:px-12 py-6" style={{ maxWidth: '1450px' }}>
        <p className="text-white text-center text-lg">
          <span className="font-bold">New Look!</span> Same great services.
        </p>
        <p className="text-center text-sm font-thin">
          Come on in and find out what we are offering.
        </p>
      </div>
    </div>
  );
};

export default AnnouncementBanner;
